Наконечники Ti-Max X55L/57L серии X предназначены для профилактических манипуляций. Обе модели наконечников обеспечивают эффективную полировку зубной, корневой поверхности и межзубного пространства за счет возвратно-поступательных движений в вертикальной плоскости с использованием насадок EVA /Profin. Наконечник Ti-Max X57L так же, как и остальные наконечники серии X, имеет титановый корпус и предназначен для использования с профилактическими колпачками и щеточками с резьбой. Уникальный механизм защиты от пыли, которым оснащены данные наконечники, предотвращает попадание загрязнений внутрь наконечника, что продлевает его срок службы.
&amp;nbsp;
Цельный титановый корпусТитан на 30% легче нержавеющей стали, более долговечен и не подвержен коррозии. Улучшенные тактильные характеристики, а также хорошо сбалансированная форма позволяют работать более эффективно и точно даже при длительных процедурах.Не царапающееся покрытие DURACOAT от NSK&amp;nbsp;- последняя разработка компании NSK в области совершенствования поверхности инструментов. К преимуществам DURACOAT относятся биосовместимость титана и отсутствие компонентов, вызывающих аллергическую реакцию, кроме того данное покрытие продлевает срок службы инструментов. DURACOAT - это ровная, устойчивая к царапинам и приятная на ощупь поверхность. Наконечник с таким покрытием удобно держать в руке.Эргономичный дизайн обеспечивает хороший обзор операционного поля и повышает безопасность проведения операции.Один наконечник для 2-х видов операций QF адаптер, поставляемый в комплекте с наконечником, позволяет использовать один наконечник для работы как с ручными, так и с машинными файлами. Вас приятно удивит не только превосходная универсальность этого наконечника, но и выгода от экономии средств. QF адаптер предназначен для использования с машинными файлами (O2,35 мм).Бесшумная работа без вибраций Для создания роторной конструкции были использованы высокоточные ноу-хау технологии, благодаря которым уровень шума значительно снижен, а вибрации сведены к минимальному уровню, что обеспечивает комфорт как для пациента, так и для врача.Микрофильтр защищает наконечник от попадания твердых частиц в систему водяного охлаждения, что гарантирует оптимальную и постоянную подачу спрея.Оптика из сотообразного стекла от NSK Несколько нитей стекловолокна спаяны в единый стекловолоконный оптический стержень, за счёт чего оптика из ячеистого стекла от NSK обеспечивает на 20% более яркое освещение, сконцентрированное именно на обрабатываемой области. Стержень из сотообразного стекла выдерживает многократную стерилизацию и сохраняет интенсивность освещения в течение длительного периода времени.Отмеченная наградой система очистки головки от NSK Встроенная в головку наконечника запатентованная система очистки представляет собой механизм, предотвращающий попадание жидкости и микрочастиц в роторную группу наконечника. Данный механизм срабатывает в результате изменения давления при остановке турбины. Система очистки головки значительно продлит срок службы подшипников, так как попадание в них инородных веществ полностью исключается.Кнопочный зажим - оригинальный механизм от NSK с автоматическим зажимным патроном, который усиливает фиксацию бора во время вращения. Зажим обеспечивает установку и извлечение бора одним нажатием кнопки без каких-либо дополнительных инструментов.Механизм зажима бора разработан таким образом, что сила удерживания бора увеличивается при возрастании скорости.Возможность автоклавирования Все наконечники NSK отличаются исключительной долговечностью и продолжительным сроком службы, даже после многократного автоклавирования при температуре до 135°C.Возможность термодезинфекции Рекомендуется дезинфицировать наконечники перед автоклавированием для обеспечения более надёжной защиты от проникновения инфекции. Символ, указанный на продукции NSK, означает, что данный наконечник можно очищать и дезинфицировать с помощью термодезинфектора.Уникальная конструкция крышки головки от NSK позволяет снизить нагрев головки во время работы. Безопасность пациента является ключевым фактором для компании NSK. Одно-канальная система подачи воды от NSK эффективно охлаждает и бор и поверхность зуба.
&amp;nbsp;
Технические характеристики:
Понижение 4:1для профилактических насадок Lamineer / насадок EVAДвижение вертикальное возвратно-поступательное (длина хода - 1,4 мм)Максимальная скорость 10000 об/минОдинарный спрейМикро-фильтрТитановый корпус с не царапающимся покрытием DURACOAT - постоянство стиляЭргономичный изогнутый корпус - идеальный угол наклона головки в любом обрабатываемом местеКомфортная стерилизацияТолько внешние компоненты корпуса изготавливаются из титана
&amp;nbsp;
 Брошюра Ti-Max X55 (скачать)
 Каталог NSK угловые наконечники (скачать)
 Каталог турбинные наконечники NSK (скачать)
