ериода времени.Отмеченная наградой система очистки головки от NSK Встроенная в головку наконечника запатентованная система очистки представляет собой механизм, предотвращающий попадание жидкости и микрочастиц в роторную группу наконечника. Данный механизм срабатывает в результате изменения давления при остановке турбины. Система очистки головки значительно продляет срок службы подшипников, так как попадание в них инородных веществ полностью исключается.Кнопочный зажим - оригинальный механизм от NSK с автоматическим зажимным патроном, который усиливает фиксацию бора во время вращения. Зажим обеспечивает установку и извлечение бора одним нажатием кнопки без каких-либо дополнительных инструментов.Механизм зажима бора разработан таким образом, что сила удерживания бора увеличивается при возрастании скорости.Возможность автоклавирования Все наконечники NSK отличаются исключительной долговечностью и продолжительным сроком службы, даже после многократного автоклавирования при температуре до 135°C.Возможность термодезинфекции Рекомендуется дезинфицировать наконечники перед автоклавированием для обеспечения более надёжной защиты от проникновения инфекции. Символ, указанный на продукции NSK, означает, что данный наконечник можно очищать и дезинфицировать с помощью термодезинфектора.Уникальная конструкция крышки головки от NSK позволяет снизить нагрев головки во время работы. Безопасность пациента является ключевым фактором для компании NSK. Одноканальная система подачи воды от NSK эффективно охлаждает и бор и поверхность зуба.
